
public class 문제05 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int num1 = 10;
		System.out.printf("%d \n",num1);
		num1++;
		System.out.printf("%d \n",num1);
		++num1;
		System.out.printf("%d \n",num1);
		--num1;
		System.out.printf("%d \n",num1);
		num1--;
		System.out.printf("%d \n",num1);

	}

}
